import React from "react";
import Navigation from "./Navigation";

export const LargeQuote = props => {
  return (
    <section id="LargeQuote">
      <div className="large-quote-text">
        <h1>"Happiness is baking cookies"</h1>
        <p>
          ...and eating them, serving them, and eating them, talking about them,
          reading and writing about them, thinking about them, and sharing them
          with you.
        </p>
      </div>
    </section>
  );
};

export default LargeQuote;
